(4, 'slam-almbany-aladary', '{\"en\":\"Safety of administrative buildings\",\"ar\":\"\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0627\\u0644\\u0645\\u0628\\u0627\\u0646\\u064a \\u0627\\u0644\\u0627\\u062f\\u0627\\u0631\\u064a\\u0629\"}', '{\"en\":\"Due to the increase in accidents and fires in facilities of all kinds (whether service, educational or administrative), which we see frequently, and the reason is largely due to lack of awareness, negligence and lack of training in applying safety requirements and managing emergency plans, crises and disasters, and the lack of contingency plans, it has become necessary to train on these Matters, identifying the basics and requirements of safety in buildings, how to apply them, developing appropriate plans, knowing the causes of accidents and work injuries, how to reduce and limit them, knowing the latest statistics of accidents and disasters, analyzing them, and benefiting from them.\",\"ar\":\"\\u0646\\u0638\\u0631\\u0627\\u064b \\u0644\\u0632\\u064a\\u0627\\u062f\\u0629 \\u0627\\u0644\\u062d\\u0648\\u0627\\u062f\\u062b \\u0648\\u0627\\u0644\\u062d\\u0631\\u0627\\u0626\\u0642 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0646\\u0634\\u0622\\u062a \\u0628\\u0623\\u0646\\u0648\\u0627\\u0639\\u0647\\u0627 ( \\u0633\\u0648\\u0627\\u0621 \\u0627\\u0644\\u062e\\u062f\\u0645\\u064a\\u0629 \\u0627\\u0648 \\u0627\\u0644\\u062a\\u0639\\u0644\\u064a\\u0645\\u064a\\u0629 \\u0627\\u0648 \\u0627\\u0644\\u0627\\u062f\\u0627\\u0631\\u064a\\u0629 ) \\u0648\\u0627\\u0644\\u062a\\u064a \\u0646\\u0631\\u0627\\u0647\\u0627 \\u0628\\u0634\\u0643\\u0644 \\u0645\\u062a\\u0643\\u0631\\u0631 \\u0648\\u064a\\u0643\\u0648\\u0646 \\u0627\\u0644\\u0633\\u0628\\u0628 \\u0628\\u0634\\u0643\\u0644 \\u0643\\u0628\\u064a\\u0631 \\u0647\\u0648 \\u0642\\u0644\\u0629 \\u0627\\u0644\\u0648\\u0639\\u064a \\u0648\\u0627\\u0644\\u0627\\u0647\\u0645\\u0627\\u0644 \\u0648 \\u0639\\u062f\\u0645 \\u0627\\u0644\\u062a\\u062f\\u0631\\u064a\\u0628 \\u0639\\u0644\\u0649 \\u062a\\u0