(6, 'adar-alslam-oalsh-almhny-fy-byy-alaaml', '{\"en\":\"Occupational safety and health management in the work environment\",\"ar\":\"\\u0625\\u062f\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0648\\u0627\\u0644\\u0635\\u062d\\u0629 \\u0627\\u0644\\u0645\\u0647\\u0646\\u064a\\u0629 \\u0641\\u064a \\u0628\\u064a\\u0626\\u0629 \\u0627\\u0644\\u0639\\u0645\\u0644\"}', '{\"en\":\"This course aims to provide the trainees with the necessary skills to identify risks in the work environment and how to control them, as well as methods of site inspection in various fields. It focuses on the need to develop a safety management system to reduce work injuries and accidents, which will be analyzed and focused on during the course to find out the root causes of accidents and methods of prevention. Of which.\",\"ar\":\"\\u062a\\u0647\\u062f\\u0641 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062f\\u0648\\u0631\\u0629 \\u0627\\u0644\\u0649 \\u062a\\u0632\\u0648\\u064a\\u062f \\u0627\\u0644\\u0645\\u062a\\u062f\\u0631\\u0628\\u064a\\u0646 \\u0628\\u0627\\u0644\\u0645\\u0647\\u0627\\u0631\\u0627\\u062a \\u0627\\u0644\\u0644\\u0627\\u0632\\u0645\\u0629 \\u0644\\u0644\\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u062e\\u0627\\u0637\\u0631 \\u0641\\u064a \\u0628\\u064a\\u0626\\u0629 \\u0627\\u0644\\u0639\\u0645\\u0644 \\u0648\\u0643\\u064a\\u0641\\u064a\\u0629 \\u0627\\u0644\\u0633\\u064a\\u0637\\u0631\\u0629 \\u0639\\u0644\\u064a\\u0647\\u0627 \\u0641\\u0636\\u0644\\u0627 \\u0639\\u0646 \\u0637\\u0631\\u0642 \\u0627\\u0644\\u062a\\u0641\\u062a\\u064a\\u0634 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0648\\u0627\\u0642\\u0639 \\u0641\\u064a \\u0645\\u062e\\u062a\\u0644\\u0641 \\u0627\\u0644\\u0645\\u062c\\u0627\\u0644\\u0627\\u062a \\u0648\\u062a\\u0631\\u0643\\u0632 \\u0639\\u0644\\u0649 \\u0636\\u0631\\u0648\\u0631\\u0629 \\u0648\\u0636\\u0639 \\u0646\\u0638\\u0627\\u0645 \\u0644\\u0627\\u062f\\u0627\\u0631\\u0629 \\u0627\\u0644\\u