(8, 'slam-alaaml-fy-alamakn-almghlk-ao-almhsor', '{\"en\":\"Safety of working indoors or confined spaces\",\"ar\":\"\\u0633\\u0644\\u0627\\u0645\\u0629 \\u0627\\u0644\\u0639\\u0645\\u0644 \\u0641\\u064a \\u0627\\u0644\\u0623\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u0645\\u063a\\u0644\\u0642\\u0629 \\u0623\\u0648 \\u0627\\u0644\\u0645\\u062d\\u0635\\u0648\\u0631\\u0629\"}', '{\"en\":\"The program aims to educate and train all workers in closed or confined spaces in all types of work, whether construction or industrial, such as contracting, excavations, sanitation, excavations, and other works that require entering confined spaces to identify risks and how to control them. OSHA defines confined or closed spaces as places that are permanently closed, large in size, have specific means of entry, and are not designed for work or permanent presence. The aim of training workers in closed places is to avoid and reduce their exposure to the risks that exist in these places.\",\"ar\":\"\\u064a\\u0647\\u062f\\u0641 \\u0627\\u0644\\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0627\\u0644\\u0649 \\u062a\\u0648\\u0639\\u064a\\u0629 \\u0648\\u062a\\u062f\\u0631\\u064a\\u0628 \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0639\\u0627\\u0645\\u0644\\u064a\\u0646 \\u0641\\u064a \\u0627\\u0644\\u0627\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u0645\\u063a\\u0644\\u0642\\u0629 \\u0623\\u0648 \\u0627\\u0644\\u0645\\u062d\\u0635\\u0648\\u0631\\u0629 \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u0648\\u0627\\u0639 \\u0627\\u0644\\u0627\\u0639\\u0645\\u0627\\u0644 \\u0633\\u0648\\u0627\\u0621 \\u0627\\u0644\\u0625\\u0646\\u0634\\u0627\\u0626\\u064a\\u0629 \\u0623\\u0648 \\u0627\\u0644\\u0635\\u0646\\u0627\\u0639\\u064a\\u0629 \\u0645\\u062b\\u0644 \\u0627\\u0644\\u0645\\u0642\\u0627\\u0648\\u0644\\u0627\\u062a \\u0648\\u0627\\u0644\\u062d\\u0641\\u0631\\u064a\\u0627\\u062a \\u0648\\u0627\\u0644\\u0635\\u0631\\u0641 \\u0627\\u0644\\u0635\\u062d\\u064a \\u0648\\u0627\\u0644\\u062a\\u0646\\u0642\\u064a\\u0628 \\u0648\\u063a\\u064a\\u0631\\u0647\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u0627\\u0639\\u0645\\u0627\\u0644 \\u0627\\u0644\\u062a\\u064a \\u062a\\u062a\\u0637\\u0644\\u0628 \\u0627\\u0644\\u062f\\u062e\\u0648\\u0644 \\u0641\\u064a \\u0627\\u0644\\u0627\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u0645\\u062d\\u0635\\u0648\\u0631\\u0629 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u062e\\u0627\\u0637\\u0631 \\u0648\\u0643\\u064a\\u0641\\u064a\\u0629 \\u0627\\u0644\\u0633\\u064a\\u0637\\u0631\\u0629 \\u0639\\u0644\\u064a\\u0647\\u0627. \\u062a\\u0639\\u0631\\u064a\\u0641 \\u0627\\u0644\\u0623\\u0648\\u0634\\u0627 (OSHA) \\u0644\\u0644\\u0623\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u0645\\u062d\\u0635\\u0648\\u0631\\u0629 \\u0623\\u0648 \\u0627\\u0644\\u0645\\u063a\\u0644\\u0642\\u0629 \\u0628\\u0623\\u0646\\u0647\\u0627 \\u0627\\u0644\\u0623\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u062a\\u064a \\u062a\\u0643\\u0648\\u0646 \\u0645\\u063a\\u0644\\u0642\\u0629 \\u0628\\u0627\\u0633\\u062a\\u0645\\u0631\\u0627\\u0631 \\u0648\\u0647\\u064a \\u0643\\u0628\\u064a\\u0631\\u0629 \\u0627\\u0644\\u062d\\u062c\\u0645 \\u0648\\u0644\\u0647\\u0627 \\u0648\\u0633\\u0627\\u0626\\u0644 \\u062f\\u062e\\u0648\\u0644 \\u0645\\u062d\\u062f\\u062f\\u0629 \\u0648\\u063a\\u064a\\u0631 \\u0645\\u0635\\u0645\\u0645\\u0629 \\u0644\\u0644\\u0639\\u0645\\u0644 \\u0623\\u0648 \\u0627\\u0644\\u062a\\u0648\\u0627\\u062c\\u062f \\u0628\\u0647\\u0627 \\u0628\\u0635\\u0641\\u0629 \\u0645\\u0633\\u062a\\u0645\\u0631\\u0629. \\u0627\\u0644\\u0647\\u062f\\u0641 \\u0645\\u0646 \\u062a\\u062f\\u0631\\u064a\\u0628 \\u0627\\u0644\\u0639\\u0627\\u0645\\u0644\\u064a\\u0646 \\u0641\\u064a \\u0627\\u0644\\u0623\\u0645\\u0627\\u0643\\u0646 \\u0627\\u0644\\u0645\\u063a\\u0644\\u0642\\u0629 \\u0647\\u0648 \\u062a\\u0641\\u0627\\u062f\\u064a \\u0648\\u062a\\u0642\\u0644\\u064a\\u0644 \\u062a\\u0639\\u0631\\u06